INSERT INTO `events` (`id`, `name`, `description`, `rules`, `event_heads`, `event_head_emails`, `event_head_phones`, `username`, `password`, `venue`, `event_time`, `reg_count`, `status`, `type`) VALUES
(1, 'Amazing Race', '  Amazing race consists of series of objective based rounds played in groups, wherein each group has to accomplish a particular task. The tasks are a combination of technical (E.g. technical quiz round) and non-technical rounds. Tentatively there will be 4 preliminary rounds, 1 main round and a final round. The event will begin with an approximate 100 participants who will be formed into groups. Each round is accompanied with the elimination of a certain number of groups and the remaining groups will proceed to the next round. The two groups that reach the final round will compete with each other for the finale. The winning group is declared as the winner of the amazing race.', NULL, 'Nikhil Prakash,Rohit George', 'nikscoo@yahoo.com', '9633080240,9895433929', 'amzingrace', 'tk13', 'Central Lawn', '2013-09-06 11:00:00', 0, 0, 'Group'),
(2, 'Best Manager', ' Tests your managerial skills. \r\n\r\nLevel 1: Group discussion: the group will be divided into appropriate number of teams and a topic will be given for GD. You will be judged on clarity of thought, relevance of the points put forward, and participation in the discussion. \r\n\r\nLevel 2: Ideate: You will be given products/ideas that have gone out of style. Your challenge is to convince people that the idea is still relevant. Participants will go around the campus and convince people to join your campaign. This campaign will run throughout the competition. \r\n\r\nLevel 3: Marketing: Participants will be given products that they have to sell. Participant with the most amount of money will be judged the winner of that level.\r\n\r\nLevel 4: Stress interview: Participants will be put through a stress interview to see how you handled a stressful environment. \r\n', NULL, 'Meghna,Amrita J', '', '+91 9496050081,+91 9895420213', 'bestmanager', 'tk13bestmanager', 'Conference Hall', '2013-09-06 12:00:00', 0, 1, 'Single'),
(3, 'Photography Workshop', ' its heavy', NULL, 'Arjun Menon', '', '9807772773', 'photography', 'photography', 'Conference Hall', '2013-09-06 10:00:00', 0, 1, 'Workshop');
